<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width,initial-scale=1" />

    <title>Analytics</title>

    <link rel="icon" type="image/png" href="favicon.png" />
    <link rel="stylesheet" href="build/bundle.css" />
    <script id="ApexCharts" type="application/javascript" src="lib/apexcharts.min.js"></script>
    <!-- <link rel="stylesheet" href="https://unpkg.com/@sjmc11/tourguidejs/dist/css/tour.min.css" /> -->
    <link rel="stylesheet" href="https://unpkg.com/webtour@1.1.0/dist/webtour.min.css" />
    <script src="https://unpkg.com/webtour@1.1.0/dist/webtour.min.js"></script>
    <style id="styles">
      /* width */
      ::-webkit-scrollbar {
        width: 5px;
        height: 2px;
      }

      /* Track */
      ::-webkit-scrollbar-track {
        background: transparent;
      }

      /* Handle */
      ::-webkit-scrollbar-thumb {
        background: rgb(47, 47, 47);
        border-radius: 8px;
      }

      /* Handle on hover */
      ::-webkit-scrollbar-thumb:hover {
        background: #555;
      }
    </style>
    <script defer src="build/bundle.js"></script>
    <script id="pdfjs" type="application/javascript" src="/lib/pdf.js"></script>
